        var connectorProfileCredentialsResult = CreateConnectorProfileCredentials();
        factoryAction?.Invoke(connectorProfileCredentialsResult);

        return connectorProfileCredentialsResult;
    }

    private Humidifier.AppFlow.ConnectorProfileTypes.ConnectorProfileCredentials CreateConnectorProfileCredentials()
    {
        var connectorProfileCredentialsResult = new Humidifier.AppFlow.ConnectorProfileTypes.ConnectorProfileCredentials();

        return connectorProfileCredentialsResult;
    }
    public override void CreateChildren(Humidifier.AppFlow.ConnectorProfileTypes.ConnectorProfileCredentials result)
    {
        base.CreateChildren(result);

        result.Amplitude ??= AmplitudeFactory?.Build();
        result.GoogleAnalytics ??= GoogleAnalyticsFactory?.Build();
        result.ServiceNow ??= ServiceNowFactory?.Build();
        result.CustomConnector ??= CustomConnectorFactory?.Build();
        result.SAPOData ??= SAPODataFactory?.Build();
